import React from "react";
import styled from "styled-components";
import BGImg from "../images/stardust.png";

function Projects(props) {
  return <PortfolioWrapper>hi</PortfolioWrapper>;
}

export default Projects;

const PortfolioWrapper = styled.div`
  width: 100vw;
  min-height: 100vh;
  margin-top: 40px;
  clip-path: polygon(
    50% 0%,
    100% 8%,
    100% 60%,
    100% 100%,
    0 100%,
    0% 60%,
    0 8%
  );
`;
